    [],nt"revision_timestamp": "2016-05-25T00:44:02.992902",nt"name": "office-of-aviation-safety-network-infrastructure",nt"isopen":
    true,nt"url": null,nt"notes": "The AVS LAN/WAN is physically and logically
    distributed across numerous AVS facilities throughout the United States such as
    Flight Standards District Offices (FSDO), Manufacturer Inspection District Offices
    (MIDO), Certificate Management Offices (CMO), and Regional Offices (RO). In addition,
    there are five (5) International Field Offices (IFOs) within the AVS LAN/WAN scope.
    All of the offices are interconnected via the FAA Intranet provided by the Air Traffic
    Organization (ATO) FAA telecommunication Infrastructure (FTI) Program. The AVS LAN/WAN
    is a General Support System (GSS) that provides AVS offices with the required automation
    to store, share, backup and archive important and relevant electronic data. The
    scope of the AVS LAN/WAN includes: Desktop and Laptop Workstations; File, Print,
    Web and Utility servers; Local Applications; and Switches. Additionally, the AVS
    LAN/WAN includes Routers in the Alaskan Region.",nt"license_title": "Other
